import LatestPostsHeader from './LatestPostsHeader'
import LatestPostCategoriesTab from './LatestPostCategoriesTab/LatestPostCategoriesTab'
export class LatestPosts extends Component {
  render() {
    return (
      <div>
        <LatestPostsHeader />
        <LatestPostCategoriesTab />
      </div>
    )
  }
}

export default LatestPosts
